import { useEffect, useState } from "react";

export default function Users() {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    fetch("http://127.0.0.1:8000/api/user/show")
      .then((res) => res.json())
      .then((data) => setUsers(data));
  });
  return (
    <div>
      <table>
        <thead>
          <th>Id</th>
          <th>User</th>
          <th>Email</th>
          <th>Action</th>
        </thead>
      </table>
    </div>
  );
}
